  const baseUrl = "/v1/courses/{course_id}/reports/{report_type}";
  import type {Report} from "../models/Report"


  const urlBuilder = (base: string, items: Record<string, unknown>) => {
    let newUrl = baseUrl
    for (const key in items) {
      newUrl = newUrl.replaceAll(`{${key}}`, `${items[key]}`)
    }

    return base + newUrl
  }

export const start_report = async (token: string, baseUrl: string, params: {
  "course_id": number;"report_type": string;"parameters"?: string;"parameters[section_ids]"?: unknown
}) => {
  console.log(token)
  const r = await fetch(urlBuilder(baseUrl, params), {
    headers: {
      "Authorization": "Bearer " + token
    }
  })
  if(r.status != 200) {
    console.error(r)
    return undefined
  }
  return (await r.json()) as Report
}
